import React from 'react'

const cameraLayout = () => {

    let cameraFlexLayout = {
        display: 'flexbox'
    }

    return(
    <div>
        <h1>Camera Layout</h1>
        <div className = {cameraFlexLayout}>
            <p>Alec</p>
            <p>Lawlor</p>
        </div>
    </div>
    )
}

export default cameraLayout
